webpackJsonp([81118664459597],{"./node_modules/json-loader/index.js!./.cache/json/sumatra-html.json":function(e,t){e.exports={data:{markdownRemark:{html:'<p>I’ve decided to take this site in a slightly different direction, It’s going to be more computer oriented i.e. tutorials, recommended programs, recommended purchases, etc.\nAnd today as a quick practice while I prepare more in depth articles I will be talking about sumatra pdf reader.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 225px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="sumatra"\n        title=""\n        src="/markholland.github.io/static/af43076c69fc36e0a66ac37a2fba89cb-321a2.png"\n        srcset="/markholland.github.io/static/af43076c69fc36e0a66ac37a2fba89cb-10d14.png 148w,\n/markholland.github.io/static/af43076c69fc36e0a66ac37a2fba89cb-321a2.png 225w"\n        sizes="(max-width: 225px) 100vw, 225px"\n      />\n    </span>\n  </span>\n  </p>\n<p>Now you’ll be thinking but I’ve already got a pdf reader! no, you haven’t, that Adobe program that takes 10 minutes to open and then another 20 to install updates is not acceptable and it’s a shame that it’s the go to pdf program seeing as windows doesn’t even come with one installed.</p>\n<p>So, sumatra, well it’s free and it’s fast, no, I mean it, like really fast.</p>\n<p>It has all the standard features of a pdf reader but who cares, it opens them and can print them, job done so go get it and realise you didn’t hate pdfs for the format but from opening them in a rubbish program.</p>\n<p><a href="http://blog.kowalczyk.info/software/sumatrapdf/free-pdf-reader.html">DOWNLOAD</a></p>',frontmatter:{date:"May 22, 2011",path:"/sumatra.html",tags:["tag"],title:"Sumatra who?",image:{childImageSharp:{resize:{src:"/markholland.github.io/static/4e9a95cf7025f7dc1da351e45e9f97b3-57c0c.jpg"}}}}}},pathContext:{prev:{excerpt:"I’m not anti-apple, not even in the slightest. I’ve owned apple products ever since the first iPod Shuffle. And apart from suddenly having to use a specific program to put music on my mp3 player it was a great experience, good battery life, decent...",html:'<p>I’m not anti-apple, not even in the slightest. I’ve owned apple products ever since the first iPod Shuffle.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 259px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 115.83011583011584%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="ipod shuffle"\n        title=""\n        src="/markholland.github.io/static/0d15083736851be7850f21d00b6f1227-34b47.png"\n        srcset="/markholland.github.io/static/0d15083736851be7850f21d00b6f1227-b99f0.png 148w,\n/markholland.github.io/static/0d15083736851be7850f21d00b6f1227-34b47.png 259w"\n        sizes="(max-width: 259px) 100vw, 259px"\n      />\n    </span>\n  </span>\n  </p>\n<p>And apart from suddenly having to use a specific program to put music on my mp3 player it was a great experience, good battery life, decent audio quality, well built and stylish at the time.</p>\n<p>It wasn’t long until my music library was growing way too fast for that little stick of white plastic to handle so I was lucky enough to be able to move up to the then called “ipod video” and my satisfaction in apple products grew even more.</p>\n<p>Since then I’ve had an ipod classic, 2 generations of ipod touchs and a more recent gen shuffle, but the adoption doesn’t end with me, my whole family now owns their own ipod touch and several gens of ipod to choose from for music, we even took the leap last year with the ipad.</p>\n<p>Now what’s blatantly missing from this love affair is any mention of mac computers and that leads me to the point of this post. Finally I’m able to give a decent opinion of the mystery behind apples computers.</p>\n<p>So what changed? well nothing really, I’d never buy a mac, no matter how justifiable the price is, so I haven’t. It turns out my library at uni has a program for allowing students free loaning of laptops and for whatever absurd reason think it’s necessary for half of those to be macs.</p>\n<p>So after just 4 days on the waiting list I was granted my macbook for 15 days, the current gen white macbook to be exact.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 300px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 64.33333333333333%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="unibody macbook"\n        title=""\n        src="/markholland.github.io/static/2ff415d46386395c70be7b44239b95c0-adfc8.png"\n        srcset="/markholland.github.io/static/2ff415d46386395c70be7b44239b95c0-b4fb9.png 148w,\n/markholland.github.io/static/2ff415d46386395c70be7b44239b95c0-ab48e.png 295w,\n/markholland.github.io/static/2ff415d46386395c70be7b44239b95c0-adfc8.png 300w"\n        sizes="(max-width: 300px) 100vw, 300px"\n      />\n    </span>\n  </span>\n  </p>\n<p>I’m not going to go into much detail but needless to say I was quickly impressed, It’s all about the subtleties that I won’t bother mentioning seeing as how if you own a mac you already know what I’d say and if you’re a non-user I doubt anything anyone could say would sway you towards osx.</p>\n<p>What I am going to mention though is that this seems like the best generation of macbook for me to have stumbled across, the new trackpad really does make all the difference, effortlessly gliding around while web browsing brings a whole new level of satisfaction. The unibody construction gives you the feeling of one solid piece of kit that you interact with, no annoying creaks to be heard here. The smaller screen, yet higher resolution than most 15.4″ pc laptops shows there’s no skimping on the spec.</p>\n<p>All in all I can understand why people choose to spend their money on macs, it’s not a decision I personally would make, I’d never buy the most expensive car, the most expensive tv, the most expensive fridge so why should I buy the most expensive computer? But I now see macs as the best computers partly justifying why they’re the most expensive.</p>\n<p>And so here I leave you, I have to return this tomorrow and go back to my Windows 7 netbook which works perfectly fine but just lacks that <em>grimace</em> “Magic”.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 580px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 125.51724137931035%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="doghousediaries apple"\n        title=""\n        src="/markholland.github.io/static/247c48de8b19e91e0e2c82c0ec410ed3-7ee4f.png"\n        srcset="/markholland.github.io/static/247c48de8b19e91e0e2c82c0ec410ed3-785d5.png 148w,\n/markholland.github.io/static/247c48de8b19e91e0e2c82c0ec410ed3-2f066.png 295w,\n/markholland.github.io/static/247c48de8b19e91e0e2c82c0ec410ed3-7ee4f.png 580w"\n        sizes="(max-width: 580px) 100vw, 580px"\n      />\n    </span>\n  </span>\n  </p>\n<p>Big thanks to <a href="http://www.thedoghousediaries.com/">The Doghouse Diaries</a> for letting me use the comic strip!</p>',id:"/Users/markholland/Documents/js/gatsby/partiallogic-gatsbyJS/posts/2011-06-06-fruity-computing/index.md absPath of file >>> MarkdownRemark",timeToRead:2,frontmatter:{date:"2011-06-06T12:00:00+00:00",path:"/fruity-computing.html",tags:["tag"],title:"Fruity computing"}},next:{excerpt:"Go back 15 years in your life, unless you were on the bleeding edge you probably didn’t have an internet connection, so when you’d think, I wonder why this happens, I wonder what that’s called, what film have I seen him in before? Not alot probably...",html:'<p>Go back 15 years in your life, unless you were on the bleeding edge you probably didn’t have an internet connection, so when you’d think, I wonder why this happens, I wonder what that’s called, what film have I seen him in before? Not alot probably.\nIsn’t it wonderful how with modern days human right of internet connectivity we can instantly abate that curiosity in mere seconds of taps on a device smaller than our hand?</p>\n<p>Yes it is, it would be great if we used it a little more to extend our knowledge in more useful areas but that’s another argument entirely.</p>\n<p>Want to know why your computer does that annoying thing, stick a brief description into a search engine and oh what a surprise the same thing happened to hundreds of others and oh look someone managed to fix it, excellent.</p>\n<p>Want to know what other films an actor has been in, oh look someone kindly wrote up everything about every last appearance said actor made.</p>\n<p>It’s hard not to sound sarcastic and go into an RIAA blessing “nothing should be free” rant but I’m genuinely in awe at how easy we have it for solving problems and expanding our knowledge. And it’s all thanks to those few individuals who know the answers that actually share this knowledge with the rest of us.</p>\n<p>And that’s the best thing about todays internet it genuinely feels free, when you ask a question on a forum, they don’t reply, visit these 3 sites and click some ads and then I’ll tell you, no they just tell you and they’re happy to do so.</p>\n<p>It’s hard to find the reason why people, who in normal life would never consider doing their job for free, then login and provide so much.</p>\n<p>So basically what I’m trying to say is, thank you to everyone who shares their knowledge with the rest of us, without these acts the internet would be a very different place.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 580px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 99.3103448275862%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="dual monitor"\n        title=""\n        src="/markholland.github.io/static/40a3b25bde8ae63f20b5615637a89de6-7ee4f.png"\n        srcset="/markholland.github.io/static/40a3b25bde8ae63f20b5615637a89de6-785d5.png 148w,\n/markholland.github.io/static/40a3b25bde8ae63f20b5615637a89de6-2f066.png 295w,\n/markholland.github.io/static/40a3b25bde8ae63f20b5615637a89de6-7ee4f.png 580w"\n        sizes="(max-width: 580px) 100vw, 580px"\n      />\n    </span>\n  </span>\n  </p>\n<p>p.s. thanks to brian from <a href="http://www.shoeboxblog.com/">shoeboxblog</a> for letting me use the image.</p>',id:"/Users/markholland/Documents/js/gatsby/partiallogic-gatsbyJS/posts/2011-05-18-it-knows-all/index.md absPath of file >>> MarkdownRemark",timeToRead:1,frontmatter:{date:"2011-05-18T12:00:00+00:00",path:"/it-knows-all.html",tags:["tag"],title:"It knows all"}}}}}});
